const Header = ({ course }) => <h1> {course}</h1>;

const Total = ({ sum }) => <p> Number of exercises {sum}</p>;

const Part = ({ parts }) => (
  <>
    <Part part={parts[0]} />
    <Part part={parts[1]} />
    <Part part={parts[2]} />
  </>
);
const App = () => {
  const course = "Helf Stack application development";
  const parts = [
    {
      name: "Funddamental of React",
      exercise: 10,
    },
    {
      name: "Using props to pass data",
      exercise: 7,
    },
    {
      name: "State of component",
      exercise: 14,
    },
  ];
  return (
    <div>
      <Header course={course} />
      <Content parts={parts} />
      <Total sum={parts[0].exercise + parts[1].exercise + parts[2].exercise} />
    </div>
  );
};

export default App;
